import React, {Component} from 'react';
import { Container, Col } from 'react-bootstrap';

class Cart extends Component {
    render(){
        return(
            <Container className="mt-5" style={{minHeight: '650px'}}>
                <Col>
                    <div className="text-center">
                        <h3>Your Cart</h3>
                    </div>
                </Col>
            </Container>
        )
    }
}

export default Cart;
